import React, { useState, useEffect } from 'react';
import { View, FlatList, Image, Text, StyleSheet } from 'react-native';

interface Member {
    title: string;
    hdurl: string;
}

const Main: React.FC = () => {
    const [members, setMembers] = useState<Member>([]);

    useEffect(() => {
        fetch('https://api.nasa.gov/planetary/apod?api_key=DEMO_KEY').then(response => {
            response.json().then(data => {
                setMembers(data);
            })
        })
        console.log(member)
    })
    return (
        <FlatList data={members}
            contentContainerStyle={{ padding: 24 }}
            KeyExtractor={member => member.title}
            renderItem={({ item: member }) => (
                <View style={styles.member}>
                    <Image style={styles.image} source={{ uri: member.hdurl }} />
                    <Text>{member.title}</Text>
                </View>
            )} />
    )
};

const styles = StyleSheet.create({
    member: {
        flexDirection: 'row',
        alignItems: 'center',
        marginBottom: 20
    },
    image: {
        width: 48,
        height: 48,
        borderRadius: 24
    }
})

export default Main;
